import "./card.css"
import React from 'react'

export default function Card(props){
    let badgeText
    if (props.openSpots === 0) {
        badgeText = "SOLD OUT"
    } else if (props.location === "Online") {
        badgeText = "ONLINE"
    } else if(props.openSpots>0){
        badgeText="AVAILABLE"
    }
return(
    <div className="card">
        <img src= {`./${props.coverImg}`} className="card-photo"/>
        { badgeText &&<button className="btn">{badgeText}</button> }
        <p className="star-items"> <img src="./Star.png" className="star-photo"/>   {props.rating}<code>({props.reviewCount})</code>. {props.location}</p>
        <p>{props.title}</p>
        <p><b>From ${props.price}</b>/per person</p>
    </div>
    );
}
